import React, { useState } from "react";
import {
  Container,
  Typography,
  TextField,
  Button,
  Grid,
  Link,
} from "@mui/material";
import {
  GoogleLoginButton,
  FacebookLoginButton,
} from "react-social-login-buttons";
import "../styles/styles.css";

function JoinUS() {
  const [isSignUp, setIsSignUp] = useState(false);
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [dob, setDob] = useState("");
  const [password, setPassword] = useState("");
  const [verifyPassword, setVerifyPassword] = useState("");
  const [errors, setErrors] = useState({});

  const handleToggleMode = () => {
    setIsSignUp((prevState) => !prevState);
    setErrors({});
  };

  const validateInputs = () => {
    const errors = {};
    if (!username.trim()) {
      errors.username = "Username is required";
    }
    if (!password.trim()) {
      errors.password = "Password is required";
    }
    if (isSignUp) {
      if (!email.trim()) {
        errors.email = "Email is required";
      }
      if (!dob.trim()) {
        errors.dob = "Date of birth is required";
      }
      if (password !== verifyPassword) {
        errors.verifyPassword = "Passwords do not match";
      }
    }
    setErrors(errors);
    return Object.keys(errors).length === 0;
  };

  const handleSignIn = (e) => {
    e.preventDefault();
    if (validateInputs()) {
      // Proceed with sign-in logic
      console.log("Sign-in successful");
    }
  };

  const handleSignUp = (e) => {
    e.preventDefault();
    if (validateInputs()) {
      // Proceed with sign-up logic
      console.log("Sign-up successful");
    }
  };

  return (
    <Container maxWidth="xs" style={{ marginLeft: "10%", width: "80%" }}>
      <div
        style={{
          marginTop: "2rem",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
        }}
      >
        <Typography variant="h4" gutterBottom>
          {isSignUp ? "Sign Up" : "Sign In"}
        </Typography>
        <form
          style={{ width: "100%", marginTop: "1rem" }}
          noValidate
          autoComplete="off"
          onSubmit={isSignUp ? handleSignUp : handleSignIn}
        >
          {isSignUp && (
            <>
              <TextField
                className="form-input"
                fullWidth
                id="username"
                label="Username"
                variant="outlined"
                margin="normal"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                error={!!errors.username}
                helperText={errors.username}
              />
              <TextField
                className="form-input"
                fullWidth
                id="email"
                label="Email"
                variant="outlined"
                margin="normal"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                error={!!errors.email}
                helperText={errors.email}
              />
              <TextField
                className="form-input"
                fullWidth
                id="password"
                label="Password"
                type="password"
                variant="outlined"
                margin="normal"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                error={!!errors.password}
                helperText={errors.password}
              />
              <TextField
                className="form-input"
                fullWidth
                id="verifyPassword"
                label="Verify Password"
                type="password"
                variant="outlined"
                margin="normal"
                value={verifyPassword}
                onChange={(e) => setVerifyPassword(e.target.value)}
                error={!!errors.verifyPassword}
                helperText={errors.verifyPassword}
              />
              <TextField
                className="form-input"
                fullWidth
                id="dob"
                label="Date of birth"
                type="date"
                variant="outlined"
                margin="normal"
                value={dob}
                onChange={(e) => setDob(e.target.value)}
                InputLabelProps={{
                  shrink: true,
                  style: {
                    transform: "none",
                    position: "static",
                    fontSize: "1rem",
                  },
                }}
                error={!!errors.dob}
                helperText={errors.dob}
              />
            </>
          )}

          {!isSignUp && (
            <>
              <TextField
                className="form-input"
                fullWidth
                id="username"
                label="Username"
                variant="outlined"
                margin="normal"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                error={!!errors.username}
                helperText={errors.username}
              />
              <TextField
                className="form-input"
                fullWidth
                id="password"
                label="Password"
                type="password"
                variant="outlined"
                margin="normal"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                error={!!errors.password}
                helperText={errors.password}
              />
            </>
          )}

          <Button
            variant="contained"
            color="primary"
            fullWidth
            style={{ marginTop: "1rem" }}
            type="submit"
          >
            {isSignUp ? "Sign Up" : "Sign In"}
          </Button>
        </form>
        <Typography variant="body2" style={{ marginTop: "1rem" }}>
          Or sign in with:
        </Typography>
        <Grid
          container
          spacing={2}
          justifyContent="center"
          style={{ marginTop: "0.5rem" }}
        >
          <Grid item xs={6}>
            <GoogleLoginButton onClick={() => console.log("Google clicked")} />
          </Grid>
          <Grid item xs={6}>
            <FacebookLoginButton
              onClick={() => console.log("Facebook clicked")}
            />
          </Grid>
        </Grid>
        <Typography variant="body2" style={{ marginTop: "1rem" }}>
          <Link href="#" onClick={() => console.log("Forgot password clicked")}>
            Forgot password?
          </Link>
        </Typography>
        <Typography variant="body2" style={{ marginTop: "1rem" }}>
          {isSignUp ? "Already have an account? " : "Don't have an account? "}
          <Link href="#" onClick={handleToggleMode}>
            {isSignUp ? "Sign in" : "Sign up"}
          </Link>
        </Typography>
      </div>
    </Container>
  );
}

export default JoinUS;
